import React from 'react'
import Card from './Card'

const FetchData = (props) => {
  return (
    <>
   
     <ol>
       
        {props.userss.map((user)=>(
          <li><h3>{user.title}</h3> 
          <p>{user.description}</p>
          <h4>${user.price}</h4>
          <img src={user.image}/>
          </li>
        ))
            }
     </ol>
     
    </>
  )
}

export default FetchData
